**__{{Site-333 -- Interdepartmental Text-Based Communications Log:}}__**
{{07/07/2023 -- 7:33 pm (EDT)}}
[[/hcell]]
[[/row]]
[[row]]
[[cell]]
* ##blue|**Vincent Bohart**##, Director;
* ##red|**Tony Catalano**##, Accounting & Tourism;
* ##green|**Leonora Morales**##, Wildlife Specialist;
* ##orange|**Noah Patel**##, Cryptozoologist & Museum Curator.
[[/cell]]
[[/row]]
[[row]]
[[hcell]]
[[/hcell]]
[[/row]]
[[row]]
[[cell]]
##green|**Leonora Morales##:** So, are we supposed to just be okay with this?

##red|**Tony Catalano##:** I know, I hate working late. 

##green|**Leonora Morales##:** No, I mean the ghost-thing that's coming here to kill us. 

##red|**Tony Catalano##:** Oh, right. Yeah to be honest not feeling great about it. But like, these things have to happen sometimes, right? Beside, I'm sure they're sending someone to take care of it. 

##green|**Leonora Morales##:** And we're just supposed to what, sit here and lock the doors until they do? Are you sure we shouldn't like, split up and go home?

##red|**Tony Catalano##:** Have you ever seen a horror movie?

##orange|**Noah Patel##:** Okay, that's the last of the storm shutters put up. 

##green|**Leonora Morales##:** Well that's a huge relief. I'm sure nailing 2-by-4s over the windows is going to stop a ghost that walks through walls. Or an actual storm for that matter. Shouldn't we have some sort of metal shutter system or something? 

##red|**Tony Catalano##:** You just pointed out that it walks through walls.

##green|**Leonora Morales##:** Yeah, don't remind me. I meant for hurricanes though.

##red|**Tony Catalano##:** We were going to, but Vincent said that 'technology can fail us when we need it most and 'I don't want any of you feeling too safe, you'll get complacent,' and 'it costs //how// much? I can get a few pallets to break down for like, a buck or two.' So here we are. 

##green|**Leonora Morales##:** Where is he anyway? I swear to god, if he left us here and took off.

##blue|**Vincent Bohart##:** Oh yee of little faith. I'm just driving in, had some important business to take care of. Sounds like we could be here for a while. 

##red|**Tony Catalano##:** Running to the 7/11 during an emergency doesn't count as important business.

##blue|**Vincent Bohart##:** Look, I'm the one responsible for all of your safety in emergency situations. That's a lot of responsibility and not the sort of thing they train you for. So the last thing I need to be doing is making those on an empty stomach. 

##green|**Leonora Morales##:** That seems like the exact sort of thing they would train a Site Director for. 

##blue|**Vincent Bohart##** Besides, don't blame me for going. It's Noah's fault that he wouldn't share.

##orange|**Noah Patel##:** I told you, those were from my grandmother.

##blue|**Vincent Bohart##** Well tell the lady to bake some more.

##green|**Leonora Morales##:** Why is no one else stressed about this? Vincent, are you sure you should be texting and driving?

##blue|**Vincent Bohart##:** Oh come on, Leonora. I'm not an idiot. I'm using speech-to-text, it's perfectly saf-- agnaj;k  shuoebg 

##blue|**Vincent Bohart##:** Dammit, who designed Cheetos to fit perfectly in the human windpipe. 

##orange|**Noah Patel##:** Okay, I rounded up whatever weapons I could find. They're in the breakroom. 

##red|**Tony Catalano##:** See, we're all taking this seriously, Leonora. 

##green|**Leonora Morales##:** Why do we have a baseball bat with nails in it? 

##red|**Tony Catalano##:** Dibs

##blue|**Vincent Bohart##:** Dibs

##blue|**Vincent Bohart##:** Ah, fuck. That sounds cool as hell. 

##orange|**Noah Patel##:** We also have a stun gun? I think. 

##blue|**Vincent Bohart##:** Is it working?

##orange|**Noah Patel##:** I don't know, do you need to charge it? I can't find a cord with prongs that fit the holes on the front. 

##blue|**Vincent Bohart##:** Keep looking, let me know when you find one to try. 

##green|**Leonora Morales##:** Vincent don't you dare, this isn't funny. The last thing we need to deal with is an unconscious Patel.

##red|**Tony Catalano##:** I don't know. I mean if it's going to get one of us...

##blue|**Vincent Bohart##:** Ah, right, yeah. The ghost. I skimmed the thing they sent in the checkout line. Sounds like a nasty piece of work. Oh hang on, there's also a gun in my office. It's in the closet. The key is in the top-left desk drawer.  

##orange|**Noah Patel##:** I'll go get it. 

##blue|**Vincent Bohart##:** Top-left, Noah. TOP-LEFT. Do not look in the top-right. Seriously, Noah, I'm not joking about that. 

##blue|**Vincent Bohart##:** Man, this fog really came in quick, I can't see past the hood of the car. 

##red|**Tony Catalano##:** You sure you should be on your phone, Vincent? 

##blue|**Vincent Bohart##:** We already covered this, I'm not even typing on it. Not like I could be if I wanted and juggling this slushie. 

##orange|**Noah Patel##:** This it?

[[=image EnfieldNo4Mk2-303Brit.jpg size="medium"]]

##red|**Tony Catalano##:** Jesus Christ, Vincent. This thing is ancient! Where did you even get this?

##blue|**Vincent Bohart##:** At an auction from some guy named Chekhov. It was pretty cheap too. 

##green|**Leonora Morales##:** How long have you had this in your office? //Why// have you had this in your office?

##blue|**Vincent Bohart##:** Would you accept 'in case of ghosts?' And you know what, if you don't, too bad. I don't need to explain myself to any of you. 

##green|**Leonora Morales##:** I'm pretty sure the Foundation has rules about properly storing firearms. 

##blue|**Vincent Bohart##:** Yeah, well I'm pretty sure they have rules about pets in the office, and showing up to work on time, and the need for functioning fire extinguishers, but I don't hear any of you complaining about that.  

##green|**Leonora Morales##:** We have literally all complained about that. Can we focus on the current situation though?

##blue|**Vincent Bohart##:** Look I'm a busy guy, I only read the complaints that mention me by name. 

##red|**Tony Catalano##:** Okay, so just to recap: we've barricaded ourselves in here, Vincent's on his way back, we have a gun from the 40s, a taser that might not be working, and a baseball bat. And we're trying to fend off a ghost that can walk through walls and explode you. Anyone have any ideas?

##blue|**Vincent Bohart##:** Noah, isn't that [*https://scp-wiki.wikidot.com/scp-7703 hole in your head] supposed to help with ghosts and spirits and stuff? Can you tell where it is? 

##orange|**Noah Patel##:** No. But I really wish you guys would stop using the microwave, it makes my vision go all fuzzy. 

##blue|**Vincent Bohart##:** Still, isn't this your deal, Noah? Cryptids and things that go bump in the night. 

##orange|**Noah Patel##:** I don't know. I didn't have a chance to look at the file. But typically they're just little guys. 

##blue|**Vincent Bohart##:** What?

##orange|**Noah Patel##:** You know, they're just kind of creepy little things that hang out. With like, big eyes or long legs. They don't actually //do// anything. 

##red|**Tony Catalano##:** Well this one is a bit of a human blender. 

##green|**Leonora Morales##:** You really haven't come across anything like this?

##red|**Tony Catalano##:** As in it blends human -- not, anyway, never mind. 

##orange|**Noah Patel##:** Not really. I've mostly been focused on the Jersey Devil. But there's a whole bunch of different cryptids: Mothman, for example, or Bigfoot. Oh and the Crawler's been making a lot of waves recently.

##green|**Leonora Morales##:** Where do you find this stuff?

##orange|**Noah Patel##:** Oh, there's a big community for it on the internet, messageboards mostly, like [*https://scp-wiki.wikidot.com/parawatch-hub Parawatch]. 

##blue|**Vincent Bohart##:** Isn't that a Foundation-run honeypot?

##orange|**Noah Patel##:** That's a baseless conspiracy. 

##green|**Leonora Morales##:** So you have no experience with the sort of monster that is, by all accounts, in the process of actively hunting us down to kill us?

##orange|**Noah Patel##:** Honestly, no. I haven't heard anything about monsters that want to kill people. They can't be that common. It's probably just the way they're presented in the media. As I said, most of them just kind of hangout out of the frame of security cameras or beside roads at night. They're harmless! 

##green|**Leonora Morales##:** Noah, this is a possibly-intangible revenant that's harmed or killed several people today. This isn't a shark, there's no unfair societal bias here. 

##red|**Tony Catalano##:** Huh, this is interesting. 

##red|**Tony Catalano##:** So when they sent us the 7769 file, they opened up Site-333's access to the broader scipnet. Normally they keep us out after we uploaded that virus by accident in 2013. 

##blue|**Vincent Bohart##:** You're thinking of 2007. 2013 was when they told us to stop using the fax machine. 

##red|**Tony Catalano##:** Right, anyway, maybe there's others like this? If Noah doesn't know anything we could take a look at what they have on record, see if there's anything useful. 

##orange|**Noah Patel##:** I really doubt there will be much, as I said, these things are typically harmless. 

##red|**Tony Catalano##:** Yeah, well we'll see. Jesus, there are several thousand files. I thought we just gave out four-digit numbers randomly. 

##green|**Leonora Morales##:** Oh, my god. Where do we even start with this? 

##red|**Tony Catalano##:** Probably best to start from the beginning, right?

##green|**Leonora Morales##:** I'm trying that, but 001 doesn't seem to be loading. 

##blue|**Vincent Bohart##:** Just pick one at random then. 

##green|**Leonora Morales##:** What are the odds that will help?

##red|**Tony Catalano##:** Fucking, hell. What is this thing? Read this:

##red|**Tony Catalano##:** "[*https://scp-wiki.wikidot.com/scp-096 SCP-096] will proceed to kill and [DATA EXPUNGED] SCP-096-1. 100% of cases have left no traces of SCP-096-1." 

##blue|**Vincent Bohart##:** What the fuck. 

##red|**Tony Catalano##:** I know, right? They don't even say what it does to you. But get this: "Due to the possibility of a mass chain reaction, including breach of Foundation secrecy and large civilian loss of life, retrieval of subject should be considered Alpha priority."

##orange|**Noah Patel##:** Okay, that has to be a fluke. No way are there multiple things like that running around. Try a different one. 

##red|**Tony Catalano##:** "Following the injection of its paralytic venom, [*https://scp-wiki.wikidot.com/scp-631 SCP-631] will remain in this position for 2-3 minutes while the victim expires. Then, it will quickly consume the victim's internal organs, replacing them with fertilized eggs produced via its tail." 

##blue|**Vincent Bohart##:** Fuck that. Leonora, you know about animals and stuff, this ring a bell for you?

##green|**Leonora Morales##:** I'm tracking abnormally social seagulls, not... whatever that is.

##orange|**Noah Patel##:** No, this isn't right! Cryptids are... they're our friends! We may not understand them, but that's okay! They wouldn't want to hurt us, not like this!

##red|**Tony Catalano##:** "[*https://scp-wiki.wikidot.com/scp-939 SCP-939]'s primary method of luring prey is the imitation of human speech in the voices of prior victims [...] SCP-939 vocalizations often imply significant distress."

##orange|**Noah Patel##:** No! They wouldn't do that! 

##red|**Tony Catalano##:** Look at this. These fucking things must be all around us.    

[[include component:image-block name=106emergenceklay.jpg|align=center|caption= [*https://scp-wiki.wikidot.com/scp-106 SCP-106], mid-emergence|width=400px]]

##green|**Leonora Morales##:** How many of them are there?

##red|**Tony Catalano##:** I don't know, it goes on and on like this for pages. 

##orange|**Noah Patel##:** I feel like I'm going to be sick. 

##red|**Tony Catalano##:** I'm not kidding at all. This is like, a sliver of them. 

##green|**Leonora Morales##:** And they what, just weren't going to tell us? God, how many more of these things could be after us. What if they're here now? 

##green|**Leonora Morales##:** We have to -- we should call someone, right? Someone needs to be able to come here and help with this! 

##red|**Tony Catalano##:** We haven't been able to contact anyone outside the site, so not looking too good there.

##orange|**Noah Patel##:** I just threw up. 

##green|**Leonora Morales##:** Okay, I want the gun. Vincent, how do you load this thing?  

##blue|**Vincent Bohart##:** Everyone calm down. Tony, stop scaring everyone. Leonora, I'll show you how it works when I get there. Noah, no one really pays attention to what you do, so I don't even get what you're so worked up about. 

##blue|**Vincent Bohart##:** So let's just chill out, people. I'm almost at the site now. Honestly, I think this whole thing is -- OH OH OH FUCK FUCK FUCK SHIT FUCK SHIT. Fucking-shit-fucking shit. 

##red|**Tony Catalano##:** Jesus.

##orange|**Noah Patel##:** Oh no oh on oh no.

##green|**Leonora Morales##:** I think I heard a car screeching outside. Vincent, that you?

##blue|**Vincent Bohart##:** Fuck. I think I hit something. 

##red|**Tony Catalano##:** Someone? 

##blue|**Vincent Bohart##:** Fuck if I know. Dammit. I'll go and check. 

##green|**Leonora Morales##:** Oh my god, Vincent. 

##blue|**Vincent Bohart##:** Look, I know. I know, okay? Jeez, I really should have auto insurance. The front of the car is all fucked up. 

##orange|**Noah Patel##:**  What about the person?

##blue|**Vincent Bohart##:** We don't know it's a person! It could be uh -- like a big raccoon or a seagull or something. 

##red|**Tony Catalano##:** You gotta go take a look. 

##blue|**Vincent Bohart##:** Yeah, no shit. Aww, damn. Okay that uh -- that looks like a person. They aren't moving.

##green|**Leonora Morales##:** Holy shit. 

##blue|**Vincent Bohart##:** Okay, well. Huh. 

##red|**Tony Catalano##:** What? 

##orange|**Noah Patel##:** Are they dead?

##green|**Leonora Morales##:** Vincent, what's going on?

##blue|**Vincent Bohart##:**  So I've got some good news...
